!function(){"use strict";const t=`${window.location.origin}/api/tweet.json?tweetId=`;tinymce.PluginManager.add("embed_tweet_static",function(e,n){const i={title:"Input Tweet ID",body:{type:"panel",items:[{type:"input",name:"tweetId",label:"Enter Tweet ID"}]},buttons:[{type:"cancel",name:"closeButton",text:"Cancel"},{type:"submit",name:"submitButton",text:"Insert Code",primary:!0}],initialData:{tweetId:""},onSubmit:function(e){const n=e.getData(),i=`${t}${n.tweetId}`;fetch(i).then(t=>t.json()).then(t=>{tinymce.activeEditor.execCommand("mceInsertRawHTML",!1,JSON.parse(t).html),e.close()})}};e.ui.registry.addButton("embed_tweet_static",{text:"Add Tweet Embed Static",onAction:function(){e.windowManager.open(i)}})})}();